[mcu]
serial: /dev/serial/by-id/usb-Klipper_stm32f429xx_1C0023000850314B33323220-if00
restart_method: command

[printer]
kinematics: corexy
max_velocity: 1000  
max_accel: 25000             #Max 4000
max_z_velocity: 5          #Max 15 for 12V TMC Drivers, can increase for 24V
max_z_accel: 200
square_corner_velocity: 5.0

[include toolhead.cfg]
[include steppers.cfg]

[probe]
pin: toolhead:PA1
y_offset: 26.88

[z_tilt]
speed: 800
horizontal_move_z: 7
z_positions:
        150,313.5
        297.5,-13.5
        2.5,-13.5
points:
        10,-16.88
        150,-16.88
        290,-16.88
        290,263.12
        150,263.12
        10,263.12

[bed_mesh]
speed: 800
algorithm: bicubic
mesh_min: 10,10
mesh_max: 290,290
probe_count: 6,6
horizontal_move_z: 7

[input_shaper]
shaper_freq_x: 66.6
shaper_type_x: mzv
shaper_freq_y: 57.2
shaper_type_y: mzv

[resonance_tester]
accel_chip: adxl345
probe_points:
    150, 150, 20

[heater_bed]
heater_pin: PA2
sensor_pin: PF3
sensor_type: NTC 100K MGB18-104F39050L32
control: pid
pid_Kp=60.564
pid_Ki=1.468
pid_Kd=624.569
min_temp: 0
max_temp: 135

[controller_fan drivers_fan]
pin: PA8
stepper: stepper_x


